import * as React from "react";
import { StyleProp, ViewStyle, Image, StyleSheet } from "react-native";

const HomeInactive = ({ style }) => {
  return (
    <Image
      style={[styles.iconsaxlinearprofile2user, style]}
      resizeMode="cover"
      source={require("../assets/HomeInactive.png")}
    />
  );
};

const styles = StyleSheet.create({
  iconsaxlinearprofile2user: {
    width: 20,
    height: 20,
    overflow: "hidden",
  },
});

export default HomeInactive;
